import 'location.dart';
import 'viewport.dart';

class Geometry {
  Location? location;
  Viewport? viewport;

  Geometry({this.location, this.viewport});

  factory Geometry.(
      Map<String, dynamic> json) {
    return Geometry(
      location: json['location'] == null
          ? null
          : Location
              .(
                  Map<String, dynamic>.from(json['location'])),
      viewport: json['viewport'] == null
          ? null
          : Viewport
              .(
                  Map<String, dynamic>.from(json['viewport'])),
    );
  }

  Map<String, dynamic>
      () {
    return {
      if (location != null)
        'location': location
            ?.(),
      if (viewport != null)
        'viewport': viewport
            ?.(),
    };
  }
}
